import React from 'react'
import { withRouter } from 'react-router-dom';

class WebPlayer extends React.Component{
  state = {
    featured: [],
    top: [],
    pod: []
  }

  render(){
    return(
      <div>
        <h3>Web Player</h3>
      </div>
    )
  }
}

export default withRouter(WebPlayer);
